import React, { useState } from "react";
import "./List.css";

function List({ data }) {
  const [isExpand, setExpand] = useState(-1);

  return (
    <div className="list__container">
      <ul className="list__items">
        {data.map((d, index) => (
          <li
            className="list__item"
            key={index}
            onClick={() => setExpand(index)}
          >
            {d.title}
          </li>
        ))}
      </ul>
      {isExpand !== -1 && (
        <ul>
          {data.map((d, index) => (
            <List data={d[isExpand].child} />
          ))}
        </ul>
      )}
    </div>
  );
}

export default List;
